import React from "react";

const Navbar = () => {
  return (
    <nav className="bg-black text-white px-6 py-4 flex justify-between items-center shadow-md">
      {/* Logo */}
      <div className="text-2xl font-bold text-green-500">
        FUEL<span className="text-white">BUDDY</span>
      </div>

      {/* Nav Links */}
      <ul className="hidden md:flex space-x-8 font-semibold">
        <li><a href="#home" className="hover:text-green-400">Home</a></li>
        <li><a href="#company" className="hover:text-green-400">Company</a></li>
        <li><a href="#solutions" className="hover:text-green-400">Solutions</a></li>
        <li><a href="#news" className="hover:text-green-400">News & Media</a></li>
        <li><a href="#contact" className="hover:text-green-400">Contact Us</a></li>
      </ul>

      {/* Order Fuel Button */}
      <button className="bg-green-500 text-black font-semibold px-5 py-2 rounded-full hover:bg-green-400">
        Order Fuel
      </button>
    </nav>
  );
};

export default Navbar;
